func DoZlibCompress(src []byte) []byte {
    var in bytes.Buffer
    w := zlib.NewWriter(&in)
    w.Write(src)
    w.Close()
    return in.Bytes()
}

func DoHuffCompress(src []byte) {
    var enc huff0.Scratch
    enc.WantLogLess = 5
    comp, _, err := huff0.Compress4X(src, &enc)
    if err != nil {
        panic(err)
    }
    fmt.Println("huff0, is ", len(string(comp)))
    dec, remain, err := huff0.ReadTable(comp, nil)
    if err != nil {
        panic(err)
    }

    out, err := dec.Decompress4X(remain, len(src))
    if err != nil {
        panic(err)
    }
    fmt.Println("huff0 decode, is ", len(string(out)))
    if !bytes.Equal(out, src) {
        panic("decompression 1x mismatch")
    }
}

func DoS2Compress(src []byte) {
    comp := s2.Encode(make([]byte, s2.MaxEncodedLen(len(src))), src)
    decoded, err := s2.Decode(nil, comp)
    if err != nil {
        panic(err)
    }
    fmt.Println("s2 compress is ", len(string(comp)))
    if !bytes.Equal(src, decoded) {
        panic("block decoder mismatch")
        return
    }
}